DROP TABLE IF EXISTS `tbl_catalogo_cuenta`;
CREATE TABLE `tbl_catalogo_cuenta`  (
  `id_catalogo` int(0) NOT NULL AUTO_INCREMENT,
  `cuenta_padre` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL,
  `tipo_cuenta` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL,
